**Edit Group**

The edit group feature enables users to modify the associated users and permissions for the selected group.&#x20;

To edit the group follow the steps given below:

1. Navigate to **Access Control > Groups** in the left side menu**.**
2. Click on the kebab menu and click on edit group.&#x20;
3. You can edit the name and description of the group.
4. Click **Next.**&#x20;
5. _Optional: From the_ _User_ _list select the users that should be added to this group._&#x20;
6. Click **Next.**&#x20;
7. Select the role that should be assigned to all members of this group. Refer Roles & Privileges for more information.
8. Select the workspaces all members of this group should have access to.
9. Select the catalogs all members of this group should have access to.
10. Select the clusters all members of this group should have access to.
11. _Optional: Click **Add another role** if additional roles are required and repeat steps 6, 7, 8 & 9._
12. Click **Next**.
13. If the summary is correct, click **Update.**

Enable Okta

1. Navigate to **Access Control > SSO** from the left side menu.
2. Click on **Add Identity Provider**
3. Provide a name for your Identity Provider
4. Select **Okta**&#x20;
5. Click **Next**&#x20;
6. Follow these steps to create a new SAML app integration in Okta.
   1. In Okta, when prompted for a **Single sign-on URL**, copy & paste the **Single sign-on URL** shown on the e6data SSO page.
   2. In Okta, when asked for an **Audience URI (SP Entity ID)**, copy & paste the **Audience URI (SP Entity ID)** shown on the e6data SSO page.
   3. In the **Attribute Statements (optional)** section create the attributes in Okta identical to those shown on the e6data SSO page. More information on defining attribute statements can be found here.

