Reset Password&x20;

If the invitee forgets their password, the reset password feature allows them to receive the invitation email again to set a new password.&#x20;

To send an email to reset the password follow the steps given below:

1. Navigate to **Access Control > Users** in the left side menu**.**
2. Click on the kebab menu and click on reset password.&#x20;
3. The invitee will receive an email to set the password.&#x20;

Personal Access Tokens (PAT)

To authenticate access when using e6data Connectors & Drivers, you can use e6data Personal Access Tokens or passwords. **e6data strongly recommends that you use tokens.**

**NOTE:** We strongly recommend copying the access token as soon as it is available on the screen, as it will be visible only one-time.&#x20;

Add Access Token

To add an access token, follow the steps below:&#x20;

1. Click on the profile icon in the console's right-top corner.&#x20;
2. Select the **User Settings** option.
3. You will be directed to the Access token page.&#x20;
4. Click on **Add Access Token.**&#x20;
5. Optional: A new window will appear where you have the option of adding comments and setting an expiry period in days.&#x20;
6. Click on **Add Token** to generate an access token.&#x20;
7. Copy the access token immediately as it will not be visible.&#x20;
8. Click **Done**.&#x20;
9. The access token is generated, it will be listed in the access token listing page.

Delete Access Token&x20;

To delete an access token:&#x20;

1. Select the tokens you want to delete.&#x20;
2. Click on the Delete Tokens.&#x20;
3. Confirm the deletion process and the access token will be deleted.&#x20;

Cross-account Catalog Access

When an organization stores data in multiple cloud accounts, it may not be desirable to create e6data workspaces in each account.

Therefore, **Cross-account Catalog Access** support allows an e6data workspace to access metastores/catalogs irrespective of cloud account. Using this feature helps to reduce complexity and cost since a single e6data Workspace can now access catalogs and data sources in multiple cloud accounts.

{% hint style="info" %}
Please be mindful of the ingress/egress costs incurred & latency introduced when querying across accounts.
{% endhint %}

1. Configure cross-account access to AWS Glue
2. Configure cross-account access to Hive Metastore (coming soon)

{% hint style="warning" %}
There is a known limitation that prevents same-account catalog queries from running after running a query in a cross-account catalog. This issue will be addressed in a future release.

Temporary workarounds:

* Disabling & re-enabling a Workspace allows same-account catalog queries to run again.&#x20;
* Maintain separate Workspaces for cross-account catalogs and same-account catalogs.
{% endhint %}

