Refresh Catalogs

When a schema is modified (tables added/deleted, etc.), a catalog should be refreshed for the changes to be reflected in e6data. You can refresh the catalog for a particular schema that has been added to the catalog. &#x20;

* Navigate to **Catalogs** from the left navbar.
* Click on the **Refresh** icon.&#x20;
* Select the database that has to be updated from the dropdown options provided.&#x20;
* Click on the **Refresh** button.

Auto Suspension

Auto suspension suspends/turns off a cluster when kept unoccupied/free for a specified period in minutes. Depending on the nature of your workloads, your instance may be in a state of rest during off-peak times, increasing the cluster compute cost. Auto-suspension allows you to reduce the cost of compute during these times.

{% hint style="info" %}
In some cases, not all executors will be available immediately when a cluster is created due to infrastructure availability limitations. The remaining executors will become active as soon as resources are available.

Therefore, the auto-suspension time is calculated starting from the time all the executors in a cluster come online.
{% endhint %}

Cluster Metrics

Within cluster metrics, you can observe the following metrics:

* **Query Stats**: Provide details about the overall aggregate of queries based on their status.
* **Cluster Utilization**: It displays the percentage of available threads used at a given time.

{% hint style="info" %}
The cluster metrics can be sorted by time by clicking on the time filter provided on the dashboard.&#x20;
{% endhint %}

{% hint style="info" %}
To view and download any metrics in full-screen mode click the triple-bar/hamburger icon.
{% endhint %}

Suspend & Resume Clusters

Clusters can be suspended when they are not in use to save infrastructure costs and resumed when they are needed again.

{% hint style="info" %}
In some cases, not all executors will come online immediately when a cluster is resumed due to infrastructure availability limitations. The remaining executors will become active as soon as resources are available.

Users will still be able to run queries using a partially active cluster.
{% endhint %}

