Data Preview

The Data Preview feature generates a query that returns the first 10 records of a table or column. This gives users a quick glimpse of what data is present before writing a query.

To generate a Data Preview, follow the steps below:

{% hint style="info" %}
Ensure that an active cluster is selected before generating a Data Preview
{% endhint %}

{% hint style="warning" %}
Do not write your final query in the tab opened using Data Preview as it will not auto-save, and there is a risk of losing work.
{% endhint %}

1. In the Schema Explorer, hover over any table or column name.
2. Click the kebab (3 dots) icon that appears.
3. Click **Data Preview**
4. A new tab will open, displaying the first 10 rows of the selected table or column.

Run a Query

{% hint style="info" %}
If the Cluster used to run the query is suspended, the user will be asked for consent to resume the Cluster before the query is run.
{% endhint %}

A query can be run from the editor in two ways:

* Click the **Run** button
* Press **Shift + Enter**

By default, all queries in a tab are run and the results of the last query will be displayed in the Result Pane.

To run only one query, see Selectively Run Queries.

{% hint style="warning" %}
If multiple queries are run and there is an error in any query, the execution of all queries will be aborted and no results will be displayed.

The query containing the error will be highlighted in red.
{% endhint %}

**Query Status**

Query execution has different statuses which are displayed in the results pane:

1. **Connecting with the engine:** This status comes first as soon as you run the query. It shows that the engine and executor trying to connect to each other.&#x20;
2. **Compiling:** This status comes after the engine and executor are connected with each other and when the query hits the cluster and till execution.&#x20;
3. **Executing:** The query is running.
4. **Failed:** You will get this status if the query fails due to some error.&#x20;

